import React, { Component } from "react";
//import $ from "jquery";
import { Helmet } from "react-helmet";

class events extends Component {
  componentDidMount() {
    //console.log($(".name").val());
  }
  render() {
    return (
      <div className="events">
        <h1> Instagram Feed </h1>
        <div id="instagram-feed1" className="instagram-feed"></div>
        <Helmet>
          <script src="../InstagramFeed.min.js" type="text/babel"></script>
          <script src="../instagramrender.js" type="text/babel"></script>
          <script>
            (function feed()
            {
              new InstagramFeed({
                username: "github",
                container: document.getElementById("instagram-feed2"),
                display_profile: false,
                display_biography: false,
                display_gallery: true,
                display_captions: false,
                callback: null,
                styling: true,
                items: 8,
                items_per_row: 4,
                margin: 1,
              })
            }
            )();
          </script>
        </Helmet>

        {/* <input className="name" value="Mau" /> */}
      </div>
    );
  }
}

export default events;
